window.bookSummaryJSON = "<p>This sexy billionaire needs a bride, and he’s not above buying one! </p> <p>Real estate mogul Sullivan Bradford’s family is pushing hard for him to get married. When his mom sets up an appointment for him with a matchmaker, he seizes the opportunity. A business arrangement with a suitable candidate is just the thing to get his parents off his back. </p> <p>The last thing Kinsley Taylor was looking for was a husband, but she can’t afford to turn down the deal Sullivan is offering. Not when becoming his bride will give her the money she needs to save her brother. </p> <p>Love and babies weren’t part of the agreement...but some contracts were meant to be broken.</p>"; 
